            "publishedAt": "2017-11-29T22:54:33.000Z",
            "channelId": "UCBR8-60-B28hp2BmDPdntcQ",
            "title": "YouTube Creators for Change: Omar Hussein",
            "description": "Omar Hussein is a creator who found his voice on YouTube. Omar created \"Al-Tayer\" a social satire show focused on the Saudi environment surrounding him. As his show gained popularity, Omar became the CEO of Uturn Entertainment, a leading multi-channel network in Saudi Arabia. As his channel neared a million subscribers, Omar stopped broadcasting his show and focused on earning a master’s degree in the UK. Omar has diversified his interest in YouTube by creating a new, self-titled vlogging channel which has become his primary home on the site.\n\nFor his YouTube Creators for Change project, Omar aims to promote empathy and understanding towards the Muslim community through a music video that demonstrates the importance of education as a way to generate tolerance and acceptance for everyone.\n\nTo see Omar's Creators for Change project, visit his channel -- https://www.youtube.com/user/honga1st",
